INSERT INTO config.i18n_core (fq_field, identity_value, translation, string) VALUES ('coust.description', 'ui.circ.items_out.longoverdue', 'hy-AM', 'Արժեքը դա թվային կոդ է և նկարագրում է թե տացքի որ ցուցակը պետք է հայտնվի քանի դեռ դուրս է տրված և արդյոք տացքը պետք է շարունակվի հայտնվել ներքևի ցուցակում, երբ հետ է ընդունվում ժամկետանց տուգանքներով։ 1 = վերին ցուցակ, ներքևի ցուցակ։ 2 = ներքևի ցուցակ, ներքևի ցուցակ։ 5 = վերին ցուցակ, մի արտածիր։ 6 = ներքևի ցուցակ, մի արտածիր։');
