INSERT INTO config.i18n_core (fq_field, identity_value, translation, string) VALUES ('coust.description', 'circ.staff_client.do_not_auto_attempt_print', 'hy-AM', 'Այս ցուցակի ստացակաների համար արգելափակիր աշխատակազմի հաճախորդի միջերեսից ավտոմատ տպելու հնարավորությունը։ Հնարավոր արժեքներն են՝  "Bill Pay", "Hold Slip", "Transit Slip", and "Hold/Transit Slip"։ Սա տարբեր է Ավտո-Տպելու ընտրավանդակից որը միանգամից արգելափակում է բոլոր ավտոմատ տպելու հնարավորությունները, քանց թե խրախուսելով լուռ տպումը ճնշելով տպման երկխոսությունը։ Այս միջերեսի ավտո- տպելու ընտրավանդակը չունի ազդեցություն այս կարգաբերման պահվածքի վրա։ Պահման, Տրանզիտի, և Պահում/Տրանզիտ թերթիկների պարագայում սա նաև ճնշում է ահազանգի երկխոսությունները որ նախորդում են տպելու երկխոսությունը (դրանք որ առաջարկում են Տպել և Չտպել որպես ընտրություն)։');
