INSERT INTO config.i18n_core (fq_field, identity_value, translation, string) VALUES ('coust.description', 'circ.lost.generate_overdue_on_checkin', 'hy-AM', 'Թույլատրելով այս կարգաբերումները հանգեցնում է ռետրոակտիվ դեռ չստեղծված ժամկետանց տուգանքների կամ կորած նյութի հետ ընդունման, մինչև հետ ընդունման ժամը (կամ մեծագույն տուգանքներին են հասել)։ Սա տարբեր է քան "վերականգնի ժամկետանցը կորելու դեպքում", քանի որ այն միայն ստեղծում է նոր ժամկետանց տուգանքներ։ Օգտագործի երկու կարգաբերումներն էլմիասին որ կորած նյութի համար ստանաս ամբողջական լրացում ժամկետանց տուգանքի համար։');
