INSERT INTO config.i18n_core (fq_field, identity_value, translation, string) VALUES ('coust.description', 'opac.org_unit_hiding.depth', 'hy-AM', 'Սա կթաքցնոի որոշակի օրգ միավորները հանրային ՀՕԱՔում, եթե ՀՕԱՔ-ի համար ֆիզիկական տեղաբաշխումը (url param "physical_loc") ժառանգում է այս կարգաբերումը։ Այս կարգաբերումը հատկորոշում է օրգ միավորի խորությունը, որը ՀՕԱՔ-ի ֆիզիկական տեղաբաշխման հետ սահմանում է թե ՀՕԱՔ-ում օրգ աստիճանակարգման որ ընտրությունը պետք է տեսանելի լինի։ Օրինակ, հիմնական Էվերգրինի տեղադրումը կունենա եռաստիճան աստիճանակարգում (Կոնսորցիում/Համակարգ/Մասնաճյուղ), որում Համակարգը ունի 1 խորությունը, և Մասնաճյուղը՝ 2։ Եթե այս կարգաբերումը պարունակում է 1 խորություն, ապա Համակարգի ամեն գրադարան, որին պատկանում է ֆիզիկական տեղաբաշխումը կլինի տեսանելի, և մնացյալ ամենը կթաքցվի։ 0 խորությունը արդյունավետորեն բոլոր օրգերը կդարձնի տեսանելի։ Աշխատակազմի հաճախրդում ներդրված ՀՕԱՔ-ը անտեսում է այս կարգաբերումները։');
