INSERT INTO config.i18n_core (fq_field, identity_value, translation, string) VALUES ('coust.description', 'sms.enable', 'hy-AM', 'Ընթացիկ հնարավորությունները որ օգտագործում են SMS ներառում են պահումը-պատրաստ է-վեցնելուն և ՛Ուղարկիր տեքստ՛ գործողությունները ՀՕԱՔ-ի բոլոր դասիչների համար։ Եթե այս կարգաբերումը թույլատրված չէ, SMS ընտրանքները օգտվողին չեն առաջարկվի։ Քանի դեռ դու ուշադիր սիլոսավորում ես օգտվողներին և ՀՕԱՔ-ի նրանց օգտագործումը, այս կարագեբրման համար բովանդակային օրգը պետք է լինի օրգ հիերարխիայում վերին օրգը, հակառակ պարագայում օգտվողները կարող են արհամարել իրենց կարգաբերումները երբ ցատկում են օրգերի միջև։');
